// src/App.js
import React from 'react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import Header from './components/Header/Header';
import Banner from './components/Banner/Banner';
import Titulo from './components/Titulo/Titulo';
import SecaoImagemTexto from './components/SecaoImagemTexto/SecaoImagemTexto';
import DropdownRegras from './components/DropdownRegras/DropdownRegras';
import Formulario from './components/Formulario/Formulario';
import Obrigado from './pages/Obrigado/Obrigado';
// import './style/global.css'
// import './style/reset.css'

function App() {
  return (
    <Router>
      <Switch>
        <Route exact path="/">
          {/* Inclua os componentes da página principal aqui */}
          <>
            <Header />
            <Banner />
            <Titulo />
            <SecaoImagemTexto />
            <DropdownRegras />
            <Formulario />
          </>
        </Route>
        <Route path="/obrigado">
          {/* A página Obrigado pode ou não incluir o Header */}
          <Obrigado />
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
